// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title ConsentManager
 * @dev Manages patient consent for data access using blockchain
 * @notice Patients can grant/revoke access to doctors for their health records
 */
contract ConsentManager {
    // Event emitted when consent is granted
    event ConsentGranted(
        string indexed nida,
        string indexed doctorId,
        address grantedBy,
        uint256 expiry,
        uint256 timestamp
    );

    // Event emitted when consent is revoked
    event ConsentRevoked(
        string indexed nida,
        string indexed doctorId,
        address revokedBy,
        uint256 timestamp
    );

    // Consent structure
    struct Consent {
        string nida;
        string doctorId;
        address patientAddress;
        uint256 grantDate;
        uint256 expiryDate;
        bool isActive;
    }

    // Mapping from NIDA+DoctorID to Consent
    mapping(bytes32 => Consent) public consents;

    // Mapping from NIDA to list of doctor IDs with access
    mapping(string => string[]) public patientConsents;

    // Patient Registry contract reference
    address public patientRegistry;

    constructor(address _patientRegistry) {
        patientRegistry = _patientRegistry;
    }

    // Generate unique key for consent mapping
    function getConsentKey(
        string memory _nida,
        string memory _doctorId
    ) private pure returns (bytes32) {
        return keccak256(abi.encodePacked(_nida, _doctorId));
    }

    /**
     * @dev Grant consent to a doctor
     * @param _nida Patient's NIDA number
     * @param _doctorId Doctor's unique ID
     * @param _expiryDays Number of days until consent expires (0 = never)
     */
    function grantConsent(
        string memory _nida,
        string memory _doctorId,
        uint256 _expiryDays
    ) public {
        bytes32 key = getConsentKey(_nida, _doctorId);

        require(!consents[key].isActive, "Consent already active");

        uint256 expiry = _expiryDays > 0
            ? block.timestamp + (_expiryDays * 1 days)
            : 0;

        consents[key] = Consent({
            nida: _nida,
            doctorId: _doctorId,
            patientAddress: msg.sender,
            grantDate: block.timestamp,
            expiryDate: expiry,
            isActive: true
        });

        patientConsents[_nida].push(_doctorId);

        emit ConsentGranted(
            _nida,
            _doctorId,
            msg.sender,
            expiry,
            block.timestamp
        );
    }

    /**
     * @dev Revoke consent from a doctor
     * @param _nida Patient's NIDA number
     * @param _doctorId Doctor's unique ID
     */
    function revokeConsent(
        string memory _nida,
        string memory _doctorId
    ) public {
        bytes32 key = getConsentKey(_nida, _doctorId);

        require(consents[key].isActive, "No active consent found");
        require(
            consents[key].patientAddress == msg.sender,
            "Only patient can revoke consent"
        );

        consents[key].isActive = false;

        emit ConsentRevoked(_nida, _doctorId, msg.sender, block.timestamp);
    }

    /**
     * @dev Check if a doctor has consent to access patient data
     * @param _nida Patient's NIDA number
     * @param _doctorId Doctor's unique ID
     * @return bool True if consent is valid
     */
    function hasConsent(
        string memory _nida,
        string memory _doctorId
    ) public view returns (bool) {
        bytes32 key = getConsentKey(_nida, _doctorId);
        Consent memory c = consents[key];

        // Check if consent exists using bytes length
        if (bytes(c.nida).length == 0) {
            return false;
        }

        if (!c.isActive) return false;

        // Check if consent has expired
        if (c.expiryDate > 0 && block.timestamp > c.expiryDate) {
            return false;
        }

        return true;
    }

    /**
     * @dev Get all doctors with consent for a patient
     * @param _nida Patient's NIDA number
     * @return string[] Array of doctor IDs
     */
    function getConsentedDoctors(
        string memory _nida
    ) public view returns (string[] memory) {
        return patientConsents[_nida];
    }

    /**
     * @dev Get consent details
     * @param _nida Patient's NIDA number
     * @param _doctorId Doctor's unique ID
     * @return Consent details
     */
    function getConsentDetails(
        string memory _nida,
        string memory _doctorId
    )
        public
        view
        returns (string memory, string memory, address, uint256, uint256, bool)
    {
        bytes32 key = getConsentKey(_nida, _doctorId);
        Consent memory c = consents[key];

        return (
            c.nida,
            c.doctorId,
            c.patientAddress,
            c.grantDate,
            c.expiryDate,
            c.isActive
        );
    }
}

contracts/HealthRecord.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title HealthRecord
 * @dev Stores health record hashes on blockchain (not actual medical data)
 * @notice Medical data is stored off-chain, only hash is stored on-chain for verification
 */
contract HealthRecord {

    // Event emitted when a new record is added
    event RecordAdded(
        string indexed recordId,
        string indexed nida,
        string recordHash,
        string recordType,
        address addedBy,
        uint256 timestamp
    );

    // Record structure
    struct MedicalRecord {
        string recordId;
        string nida;
        string recordHash;      // SHA-256 hash of the encrypted medical data
        string recordType;      // "lab_results", "xray", "consultation", etc.
        string facility;
        string doctorId;
        uint256 timestamp;
        bool isValid;
    }

    // Mapping from record ID to record details
    mapping(string => MedicalRecord) public records;

    // Mapping from NIDA to list of record IDs
    mapping(string => string[]) public patientRecords;

    // Only registered facilities/doctors can add records (simplified for demo)
    address public admin;

    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    /**
     * @dev Add a new health record hash to blockchain
     * @param _recordId Unique record identifier
     * @param _nida Patient's NIDA number
     * @param _recordHash SHA-256 hash of encrypted medical data
     * @param _recordType Type of medical record
     * @param _facility Hospital/clinic name
     * @param _doctorId Doctor's ID
     */
    function addRecord(
        string memory _recordId,
        string memory _nida,
        string memory _recordHash,
        string memory _recordType,
        string memory _facility,
        string memory _doctorId
    ) public onlyAdmin {
        require(bytes(records[_recordId].recordId).length == 0, "Record ID already exists");
        require(bytes(_recordHash).length == 64, "Invalid hash length (should be 64 chars)");

        records[_recordId] = MedicalRecord({
            recordId: _recordId,
            nida: _nida,
            recordHash: _recordHash,
            recordType: _recordType,
            facility: _facility,
            doctorId: _doctorId,
            timestamp: block.timestamp,
            isValid: true
        });

        patientRecords[_nida].push(_recordId);

        emit RecordAdded(_recordId, _nida, _recordHash, _recordType, msg.sender, block.timestamp);
    }

    /**
     * @dev Verify if a record hash matches the stored hash
     * @param _recordId Record identifier
     * @param _recordHash Hash to verify
     * @return bool True if hash matches
     */
    function verifyRecord(string memory _recordId, string memory _recordHash) public view returns (bool) {
        return keccak256(bytes(records[_recordId].recordHash)) == keccak256(bytes(_recordHash));
    }

    /**
     * @dev Get all record IDs for a patient
     * @param _nida Patient's NIDA number
     * @return string[] Array of record IDs
     */
    function getPatientRecordIds(string memory _nida) public view returns (string[] memory) {
        return patientRecords[_nida];
    }

    /**
     * @dev Get record details by ID
     * @param _recordId Record identifier
     * @return Record details
     */
    function getRecord(string memory _recordId) public view returns (
        string memory,
        string memory,
        string memory,
        string memory,
        string memory,
        string memory,
        uint256,
        bool
    ) {
        MedicalRecord memory r = records[_recordId];
        return (
            r.recordId,
            r.nida,
            r.recordHash,
            r.recordType,
            r.facility,
            r.doctorId,
            r.timestamp,
            r.isValid
        );
    }

    /**
     * @dev Invalidate a record (only in case of error)
     * @param _recordId Record identifier
     */
    function invalidateRecord(string memory _recordId) public onlyAdmin {
        records[_recordId].isValid = false;
    }
}

contracts/PatientRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title PatientRegistry
 * @dev Stores patient registration details on the blockchain
 * @notice Uses NIDA (National ID) as unique identifier for Tanzanian patients
 */
contract PatientRegistry {

    // Event emitted when a new patient is registered
    event PatientRegistered(
        string indexed nida,
        address indexed patientAddress,
        string fullName,
        uint256 timestamp
    );

    // Patient structure
    struct Patient {
        string nida;          // National ID (15 digits)
        string fullName;
        string email;
        string phone;
        address walletAddress;
        uint256 registrationDate;
        bool isActive;
    }

    // Mapping from NIDA to Patient details
    mapping(string => Patient) public patients;

    // Mapping from wallet address to NIDA
    mapping(address => string) public walletToNida;

    // Only registered patients can call
    modifier onlyPatient(string memory _nida) {
        require(
            keccak256(bytes(patients[_nida].nida)) == keccak256(bytes(_nida)),
            "Patient not registered"
        );
        _;
    }

    /**
     * @dev Register a new patient on the blockchain
     * @param _nida National ID number (15 digits)
     * @param _fullName Patient's full name
     * @param _email Patient's email
     * @param _phone Patient's phone number
     */
    function registerPatient(
        string memory _nida,
        string memory _fullName,
        string memory _email,
        string memory _phone
    ) public {
        require(bytes(_nida).length >= 15, "NIDA must be at least 15 digits");
        require(bytes(patients[_nida].nida).length == 0, "Patient already registered");

        // Check if wallet already registered using bytes comparison
        bytes memory walletNidaBytes = bytes(walletToNida[msg.sender]);
        require(walletNidaBytes.length == 0, "Wallet already registered");

        patients[_nida] = Patient({
            nida: _nida,
            fullName: _fullName,
            email: _email,
            phone: _phone,
            walletAddress: msg.sender,
            registrationDate: block.timestamp,
            isActive: true
        });

        walletToNida[msg.sender] = _nida;

        emit PatientRegistered(_nida, msg.sender, _fullName, block.timestamp);
    }

    /**
     * @dev Get patient details by NIDA
     * @param _nida National ID number
     * @return Patient details
     */
    function getPatient(string memory _nida) public view returns (
        string memory,
        string memory,
        string memory,
        string memory,
        address,
        uint256,
        bool
    ) {
        Patient memory p = patients[_nida];
        return (
            p.nida,
            p.fullName,
            p.email,
            p.phone,
            p.walletAddress,
            p.registrationDate,
            p.isActive
        );
    }

    /**
     * @dev Check if patient is registered
     * @param _nida National ID number
     * @return bool True if patient exists
     */
    function isPatientRegistered(string memory _nida) public view returns (bool) {
        return bytes(patients[_nida].nida).length > 0;
    }

    /**
     * @dev Get NIDA by wallet address
     * @param _wallet Patient's wallet address
     * @return string NIDA number
     */
    function getNidaByWallet(address _wallet) public view returns (string memory) {
        return walletToNida[_wallet];
    }
}

